func TestMain(m *testing.M) {
	setup()
	code := m.Run()
	tearDown()
	os.Exit(code)
}

func setup() {
	// Load testing configuration
	cfg, err := config.LoadConfig("../../../cmd/config/config-test.yaml")
	if err != nil {
		panic(err)
	}

	// Set up a connection to the testing database
	db, err = database.NewDB(&cfg.Database)
	if err != nil {
		panic(err)
	}

	logFolder := flag.String("log.file", "../../../logs", "Logging file")
	currentDir, err := os.Getwd()
	if err != nil {
		fmt.Println("Error:", err)
		return
	}

	fmt.Println("Current working directory:", currentDir)

	flag.Parse()
	fmt.Println("Current working directory:", currentDir)

	flag.Parse()

	// set logging file
	//logging.OutputScreen = true
	//logging.Filename = *logFile
	logging.InitLogger()
	currentDate := time.Now().Format("2006-01-02")
	logFilePath := fmt.Sprintf("%s/app_test_%s.log", *logFolder, currentDate)

	// Create the log file if it doesn't exist
	logFile, err := os.OpenFile(logFilePath, os.O_CREATE|os.O_WRONLY|os.O_APPEND, 0666)
	if err != nil {
		fmt.Println("Error creating log file: ", err)
		log.Fatal("Error creating log file:", err)
	}

	// Set the logrus output to the log file
	logging.Log.SetOutput(logFile)

	imageRepository = repository.NewImagesRepository(cfg.ImagePath)
}

func clearDB(tables []string) {
	sqlDB, err := db.DB()
	if err != nil {
		panic(err)
	}
	for _, v := range tables {
		sqlDB.Exec("delete from " + v)
	}

}

func tearDown() {
	sqlDB, err := db.DB()
	if err != nil {
		panic(err)
	}
	defer sqlDB.Close()

}

func compressImage(img image.Image, format string) ([]byte, error) {
	// Resize image to ensure it's under 1MB
	resizedImg := resize.Resize(800, 0, img, resize.Lanczos3)

	var buffer bytes.Buffer
	switch format {
	case "jpeg", "jpg":
		err := jpeg.Encode(&buffer, resizedImg, nil)
		if err != nil {
			return nil, err
		}
	case "png":
		err := png.Encode(&buffer, resizedImg)
		if err != nil {
			return nil, err
		}
	case "gif":
		// Optionally, you could support GIFs, though resize.Lanczos3 may not be ideal for GIFs
		// For simplicity, let's return an error for unsupported formats
		return nil, fmt.Errorf("GIF format not supported for compression")
	default:
		return nil, fmt.Errorf("unsupported image format: %s", format)
	}

	if buffer.Len() > 1<<20 { // 1MB in bytes
		return nil, fmt.Errorf("compressed image exceeds 1MB")
	}

	return buffer.Bytes(), nil
}

